import "../MixLad.css"
import NavBar from "../components/NavBar";
import { Link, Route, Routes } from "react-router-dom";
import Footer from "../components/Footer";
import Aos from "aos";

import Header from "../components/Mixed/Header";


const Mixed = () => {
    return (

        <div className="container-all">
            <NavBar active="Mixed" />
            <Header title={["OUR", "<span >MIXED <span />", "MEMBERSHIPS"]} class="black" />
            <Footer />
        </div>
    )
}

export default Mixed;
